INSERT INTO `reply` VALUES (1,9,264,'反正我们会飞, 飞的时候顺手扔到恒星里就好了',0,'2017-05-21 07:16:30'),(2,9,264,'/topic#9/chat/20170521/71afa094-d4f9-4b4e-996b-2677d34d9ccb_res07_attpic_brief.jpg',1,'2017-05-21 07:17:44'),(3,9,257,'可我们又不是都会飞',0,'2017-05-21 07:18:53'),(4,9,264,'那是你们的问题了',0,'2017-05-21 07:19:09'),(5,9,257,'幸亏我们是分散居住在各个地方, 垃圾没那么集中:)',0,'2017-05-21 07:19:41'),(6,9,264,'还好意思说, 就是这样垃圾才遍地都是',0,'2017-05-21 07:20:20'),(7,9,267,'为什么不考虑下怎么解决呢?',0,'2017-05-21 07:20:54'),(8,9,257,'/topic#9/chat/20170521/9fddb7da-f928-4152-85d0-67683e2d27a5_20163258282298677.jpg',1,'2017-05-21 07:21:48'),(9,9,257,'为什么不问下哥斯拉呢?',0,'2017-05-21 07:23:36'),(10,9,260,'啊?',0,'2017-05-21 07:23:52'),(11,9,260,'谁叫我啊?',0,'2017-05-21 07:24:07'),(12,9,257,'我也是醉了, 是哥斯拉',0,'2017-05-21 07:25:10'),(13,9,260,'这样啊, 那我先去解题了, 8',0,'2017-05-21 07:25:38'),(14,9,259,'其实找我也没用, 我是住在地球下面的',0,'2017-05-21 07:26:13'),(15,9,257,'看来问题无解了',0,'2017-05-21 07:27:06'),(16,9,261,'就像迪迦说的, 顺手扔到太阳就好了',0,'2017-05-21 07:27:37'),(17,9,261,'也许这是地球的叫法, 但扔到一些毁灭性的地方就不错\r\n而且看起来垃圾也不算太多, 至少还能挤出去/(ㄒoㄒ)/~~',0,'2017-05-21 07:28:43'),(18,9,264,'连1号大神都挺我了',0,'2017-05-21 07:29:41'),(19,9,264,'/topic#9/chat/20170521/1a122340-ade1-44a5-a898-9513b88ce2dd_timg.jpg',1,'2017-05-21 07:31:01'),(20,8,257,'有时候超人会打我们, 但我们也是为了生存啊',0,'2017-05-21 07:31:59'),(21,8,257,'有时候他们只是觉得我们样子不好看',0,'2017-05-21 07:32:27'),(22,8,257,'所以我觉得应该消除歧视',0,'2017-05-21 07:32:43'),(23,8,264,'可是你们会搞破坏啊?',0,'2017-05-21 07:33:20'),(24,8,257,'/topic#8/chat/20170521/37f6b60a-3eac-4b4b-8392-4855bfcdf77a_timg (1).jpg',1,'2017-05-21 07:35:05'),(25,8,257,'可能是为了寻找一些东西吧?',0,'2017-05-21 07:35:38'),(26,8,263,'寻找什么?食物?!',0,'2017-05-21 07:36:44'),(27,8,260,'有时候是草稿纸.....',0,'2017-05-21 07:37:16'),(28,8,257,'.......',0,'2017-05-21 07:37:35'),(29,8,1,'........',0,'2017-05-21 07:37:51'),(30,8,259,'.....',0,'2017-05-21 07:38:06'),(31,8,258,'........',0,'2017-05-21 07:38:29'),(32,8,258,'我竟无言以对',0,'2017-05-21 07:38:34'),(33,8,257,'连潜水的2号小怪兽都炸出来了',0,'2017-05-21 07:38:52'),(34,8,258,'............',0,'2017-05-21 07:42:41'),(35,8,258,'继续潜水',0,'2017-05-21 07:42:57'),(36,8,264,'打倒小怪兽',0,'2017-05-21 07:43:38'),(37,8,257,'你的言论很危险!!',0,'2017-05-21 07:43:53'),(39,8,257,'/topic#8/chat/20170521/42c4174c-f144-4cc3-a746-8b0b401c39f6_timg2.jpg',1,'2017-05-21 07:45:37'),(40,8,264,'好了好了, 我已经把我的建设性意见放在分享区了\r\n大家可以看看',0,'2017-05-21 07:46:26'),(41,8,257,'已举报',0,'2017-05-21 07:48:06'),(42,9,257,'/topic#9/chat/20170521/881a5f72-1cae-4fb6-b4d7-3203e4d7a05e_u=1474484978,3105102443&fm=23&gp=0.jpg',1,'2017-05-21 07:50:38'),(43,5,1,'恩',0,'2017-05-21 08:13:29'),(44,10,1,'分享',0,'2017-05-21 08:13:38'),(45,10,1,'分享',0,'2017-05-21 08:13:41');
