INSERT INTO `topic` VALUES (4,'这是一个授权讨论区','授权讨论区内容01\r\n授权讨论区内容02\r\n授权讨论区内容03',1,1,1,0,'2017-05-21 06:39:59','2017-05-21 06:39:59'),(5,'只有授权小组的成员才可以访问这个讨论区','',1,1,1,1,'2017-05-21 08:13:29','2017-05-21 06:40:24'),(6,'或者权限为admin, root的才可以访问授权讨论区','',1,1,1,0,'2017-05-21 06:40:48','2017-05-21 06:40:48'),(7,'标题必选, 描述可选','',0,1,1,0,'2017-05-21 06:41:06','2017-05-21 06:41:06'),(8,'关于实现宇宙和平的一些探讨','请大家踊跃发言哈.\r\n不管是奥特曼还是小怪兽都可以提出你们的想法!\r\n水瓶座的围观路人也是可以参与的!!!',0,1,1,21,'2017-05-21 07:48:07','2017-05-21 06:48:02'),(9,'宇宙垃圾到底要怎么处理, 已经开始威胁奥特曼和小怪兽的生存安全了','据第三方组织的调查报告,\r\n宇宙垃圾已经遍布各大主要行星, 其中M87星云尤其严重.\r\n所以大家打算怎么处理?',0,1,1,20,'2017-05-21 07:50:39','2017-05-21 06:53:04'),(10,'小怪兽日常生活的分享','各位小怪兽请分享一下自己生活的日常',1,1,1,2,'2017-05-21 08:13:41','2017-05-21 06:54:44'),(11,'有多少奥特曼的底裤是穿在外面的?','超人也算',1,1,1,0,'2017-05-21 06:55:24','2017-05-21 06:55:24'),(12,'怎么看待迪迦打败卡密拉?','其他奥特曼能讲一下这件事的详细过程吗?',1,1,1,0,'2017-05-21 06:56:35','2017-05-21 06:56:35'),(13,'公开讨论区分页测试0号','',0,1,1,0,'2017-05-21 08:08:46','2017-05-21 08:08:46'),(14,'公开讨论区分页测试1号','',0,1,1,0,'2017-05-21 08:08:46','2017-05-21 08:08:46'),(15,'授权分页测试2号','',1,1,1,0,'2017-05-21 08:08:46','2017-05-21 08:08:46'),(16,'授权分页测试3号','',1,1,1,0,'2017-05-21 08:08:47','2017-05-21 08:08:47'),(17,'公开讨论区分页测试4号','',0,1,1,0,'2017-05-21 08:08:47','2017-05-21 08:08:47'),(18,'公开讨论区分页测试5号','',0,1,1,0,'2017-05-21 08:08:48','2017-05-21 08:08:48'),(19,'授权分页测试6号','',1,1,1,0,'2017-05-21 08:08:48','2017-05-21 08:08:48'),(20,'授权分页测试7号','',1,1,1,0,'2017-05-21 08:08:49','2017-05-21 08:08:49'),(21,'授权分页测试8号','',1,1,1,0,'2017-05-21 08:08:50','2017-05-21 08:08:50'),(22,'授权分页测试9号','',1,1,1,0,'2017-05-21 08:08:51','2017-05-21 08:08:51'),(23,'公开讨论区分页测试10号','',0,1,1,0,'2017-05-21 08:08:51','2017-05-21 08:08:51'),(24,'公开讨论区分页测试11号','',0,1,1,0,'2017-05-21 08:08:52','2017-05-21 08:08:52'),(25,'公开讨论区分页测试12号','',0,1,1,0,'2017-05-21 08:08:52','2017-05-21 08:08:52'),(26,'授权分页测试13号','',1,1,1,0,'2017-05-21 08:08:53','2017-05-21 08:08:53'),(27,'公开讨论区分页测试14号','',0,1,1,0,'2017-05-21 08:08:53',